import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import routes from "../routes"
import Sidebar from "../sidebar";

const PerformanceRating = () => {
  return (
    <div>
            <Sidebar routes={routes} />
    </div>
  )
}

export default PerformanceRating
